import React from 'react';
import CardData from './CardData'
import Card from './Card'


export default function App() {
  const cards = CardData.map(item => {
    return (
      <Card 
          key={item.id}
          question={item.question}
          answer={item.answer}
      />
    )
  })

  return (
    <div>
      <input type="text"></input>
      {cards}
    </div>
  )
}
